  console.log("Hello from the app component")

  const now = new Date()
  const a = 5
  const b = 5

  return (
  <div>
    <p>Hello World, the time is { now.toString() }</p>

    <p>
      {a} + {b} is {a+b}
    </p>
  </div>
  )
}

export default App;
